import React from 'react';
import { useHistory } from 'react-router-dom';
import './ITEquipmentLanding.css'; // Create this CSS file for styles

const ITEquipmentLanding = () => {
  const history = useHistory();

  return (
    <div className="landing-container">
      <h1>IT Equipment Landing Page</h1> {/* Add this line for debugging */}
      <div className="card" onClick={() => history.push('/it-equipment-view')}>
        <div className="card-content">
          <h3>View IT Equipments</h3>
          <p>More info</p>
        </div>
      </div>
      <div className="card" onClick={() => history.push('/it-equipment-manager')}>
        <div className="card-content">
          <h3>Modify IT Equipments</h3>
          <p>More info</p>
        </div>
      </div>
    </div>
  );
};

export default ITEquipmentLanding;
